export class AppComponent {
  title = 'TestApp';
}
<div class="container-fluid text-white">
  <div class="row">
    <div class="col-md-8 bg-color-registration-page vh-100 pt-5 px-5">
      <app-event-registration></app-event-registration>
    </div>
